Today, I joined with @modelallianceny and @amazonlaborunion’s @chris.smalls_ to call on lawmakers to pass the #FashionWorkersAct – first in the nation legislation that would extend labor protections to models, content creators, and creative artists in New York’s fashion industry. 

We need proper protection just like any other worker. It’s time! 

